import React, {useState} from "react";


function CreateNote() {

  const[note, setNote] = useState({
      title:"",
      content:""
  })


  return (
    <div>
      <form>
        <input name="title" value={note.title} placeholder="Title" />
        <textarea name="content" placeholder="Take a note..." rows="3" />
        <button>Add</button>
      </form>
    </div>
  );
}

export default CreateNote;
